import { Component, OnInit } from '@angular/core';
import { CommonModule } from '@angular/common';
import { ActivatedRoute, Router } from '@angular/router';
import { AuthService } from '../../../core/services/auth.service';

@Component({
  selector: 'app-login',
  standalone: true,
  imports: [CommonModule],
  templateUrl: './login.component.html',
  styleUrl: './login.component.scss',
})
export class LoginComponent implements OnInit {
  returnUrl = '/home';

  constructor(
    public auth: AuthService,
    private router: Router,
    private route: ActivatedRoute
  ) {}

  ngOnInit(): void {
    this.returnUrl = this.route.snapshot.queryParams['returnUrl'] || '/home';
    if (this.auth.isSsoEnabled && this.auth.isAuthenticated) {
      const url = sessionStorage.getItem('loginReturnUrl') || this.returnUrl;
      sessionStorage.removeItem('loginReturnUrl');
      this.router.navigateByUrl(url);
    }
  }

  loginWithGoogle(): void {
    sessionStorage.setItem('loginReturnUrl', this.returnUrl);
    this.auth.login();
  }
}
<div class="login-page">
  <div class="login-card">
    <h1>MiniCommerce</h1>
    <p class="subtitle">Sign in to continue</p>

    <section class="sso-section">
      <h2 class="sso-heading">Make me login with SSO</h2>
      @if (auth.isSsoEnabled) {
        <button type="button" class="btn-google" (click)="loginWithGoogle()">
          <svg class="google-icon" viewBox="0 0 24 24" aria-hidden="true">
            <path fill="#4285F4" d="M22.56 12.25c0-.78-.07-1.53-.2-2.25H12v4.26h5.92c-.26 1.37-1.04 2.53-2.21 3.31v2.77h3.57c2.08-1.92 3.28-4.74 3.28-8.09z"/>
            <path fill="#34A853" d="M12 23c2.97 0 5.46-.98 7.28-2.66l-3.57-2.77c-.98.66-2.23 1.06-3.71 1.06-2.86 0-5.29-1.93-6.16-4.53H2.18v2.84C3.99 20.53 7.7 23 12 23z"/>
            <path fill="#FBBC05" d="M5.84 14.09c-.22-.66-.35-1.36-.35-2.09s.13-1.43.35-2.09V7.07H2.18C1.43 8.55 1 10.22 1 12s.43 3.45 1.18 4.93l2.85-2.22.81-.62z"/>
            <path fill="#EA4335" d="M12 5.38c1.62 0 3.06.56 4.21 1.64l3.15-3.15C17.45 2.09 14.97 1 12 1 7.7 1 3.99 3.47 2.18 7.07l3.66 2.84c.87-2.6 3.3-4.53 6.16-4.53z"/>
          </svg>
          Sign in with Google
        </button>
      } @else {
        <p class="no-sso">Google sign-in is not configured. Set <code>googleClientId</code> in environment.</p>
      }
    </section>
  </div>
</div>
